document.addEventListener("DOMContentLoaded",(function(){loadData("repos.json").then((e=>{const a=$(".repos").el;e.forEach((e=>{const s=langKey(e.language),[t,r]=e.full_name.split("/"),l=el("div",{className:`box item repo ${s}`});let d,o="cube";e.archived?(l.classList.add("archived"),o="file-archive-o",d="Archived"):e.fork?(l.classList.add("fork"),o="code-fork",d="Forked"):e.is_template?(l.classList.add("template"),o="clone",d="Template"):e.private&&(l.classList.add("private"),o="lock",d="Private"),l.innerHTML=`<div class="repo-header"><i class="fa fa-${o} repo-badge" aria-hidden="true"></i><h3 class="repo-name"><span>${t}</span>/<a href="${e.html_url}" target="_blank">${r}</a></h3>`+(d?`<span class="repo-status">${d}</span>`:"")+"</div>",a.appendChild(l)}))})).catch(console.error)}));